window.bookSummaryJSON = "<p><b>It's easy to wager everything when you have nothing to lose.</b></p> <p>It's a hard life for a young mortal girl, living on the streets. After Lee Jia narrowly escapes a fate worse than death, her last ditch effort to flee her pursuers and survive the winter finds her accidentally enrolled in a brand-new academy for immortals. Now faced with a once-in-a-lifetime opportunity, Lee Jia will have to survive a violent roommate, arrogant young masters, and—worst of all—social hierarchies in order to carve out a place for herself in the world of magic, martial arts, and cultivation.</p> <p>Join Lee Jia in a progression fantasy adventure about friendship, self-discovery, personal growth, and, of course, magical martial arts!</p>"; 
